$lang['objectslend']['The items offered for rent are in good condition and verification rental contradictory to their status is at the time of withdrawal. No claims will be accepted after the release of the object. Writing by the store a list of reservation does not exempt the customer checking his retrait. The payment of rent entitles the purchaser to make normal use of the loaned object. If the object is rendered in a degraded state, the seller reserves the right to collect all or part of the security deposit. In case of deterioration of the rented beyond the standard object, a financial contribution will be required for additional cleaning caused. In case of damage, loss or theft of the rented property, the deposit will not be refunded automatically to \'the company as damages pursuant to Article 1152 of the Civil Code and without that it need for any other judicial or extra-judicial formality. In some other cases not listed above and at the discretion of the seller, the deposit check may also be collected in whole or party.'] = 'Les objets proposés à la location sont en bon état de location et la vérification contradictoire de leur état se fait au moment du retrait. Aucune réclamation ne sera recevable après la sortie de l\'objet. La rédaction par le magasin d\'une liste de réservation n\'exonère pas le client de la vérification de sa tenue au moment du retrait. Le paiement d\'une location donne droit à l\'acheteur de pouvoir faire un usage normal de l\'objet prêté. Si l\'objet est rendu dans un état dégradé, le vendeur se réserve le droit d\'encaisser tout ou partie du chèque de caution. En cas de dégradation de l\'objet loué au-delà des standards, une participation financière sera exigée pour le nettoyage supplémentaire occasionné. En cas de détérioration, de perte ou de vol de l\'objet loué, le dépôt de garantie restera acquis de plein droit à la société, à titre de dommages et intérêts conformément aux dispositions de l\'article 1152 du Code Civil et ce sans qu\'il soit besoin d\'aucune autre formalité judiciaire ou extra judiciaire. Dans certains autres cas, non énumérés ci-dessus et laissés à l\'appréciation du vendeur, le chèque de caution peut également être encaissé en tout ou partie.';

